import './Main.css';
import Header from './components/header/Header';
import {Route, Link, Router} from 'react-router-dom'
import Blog from './pages/Blog';
import Cenik from './pages/Cenik';
import Kontakt from './pages/Kontakt';
import NaseSluzby from './pages/NaseSluzby';
import Reference from './pages/Reference';
import Realizace from './pages/Realizace';
import Vizualizace from './pages/Vizualizace';
function Main() {
  return (
    <div className="App">
      <Header />
      <Router exact to='/' component={Home} />
      <Router exact to='/Blog' component={Blog} />
      <Router exact to='/Cenik' component={Cenik} />
      <Router exact to='/Kontakt' component={Kontakt} />
      <Router exact to='/NaseSluzby' component={NaseSluzby} />
      <Router exact to='/Reference' component={Reference} />
      <Router exact to='/Realizace' component={Realizace} />
      <Router exact to='/Vizualizace' component={Vizualizace} />
    </div>
  );
}

export default Main;
